import { makeStyles } from "@material-ui/core";

export default makeStyles((theme) => ({
    headRow: {
        backgroundColor: '#F1F6FC',
        width: '100%',
        display: 'flex'
    },
    card: {
        backgroundColor: '#F1F6FC',
    },
    row: {
        backgroundColor: '#FFFFFF',
    }
}))
